unsigned int gcd (unsigned int a, unsigned int b)
{
    if (a == 0 &&b == 0)
        b = 1;
    else if (b == 0)
        b = a;
    else if (a != 0)
        while (a != b)
            if (a <b)
                b -= a;
            else
                a -= b;

    return b;
}

unsigned int gcd_adapted_mul(unsigned int a, unsigned int b)
{
	int condition, condition2, condition3;
	condition = a == 0;
	condition2 = b == 0;
/*
    if (condition & condition2)
        b = 1;
    else if (condition2)
        b = a;
    else if (!condition)
	*/
	while ((a != b) & (!condition)) {
            asm("cmpu %0,%1,%2": "=r" (condition3): "r" (b), "r" (a));
            condition3 = condition3 < 0;
            b -= a*condition3;
            a -= b*!condition3;
            /*
            if (condition3)
            //if (a <b)
                b -= a;
            else
                a -= b;
                */
	}

    b = (condition & condition2) | a*condition2 | b*!condition;


    return b;
}

// This method could be a version without any ifs, although it was not done because probably it is not worth it, since they
// are not inside a loop.
unsigned int gcd_adapted_mul2(unsigned int a, unsigned int b)
{
	int condition, condition2, condition3;
	condition = a == 0;
	condition2 = b == 0;

    if (condition & condition2)
        b = 1;
    else if (condition2)
        b = a;
    else if (!condition)
        while (a != b) {
            asm("cmpu %0,%1,%2": "=r" (condition3): "r" (b), "r" (a));
            condition3 = condition3 < 0;
            b -= a*condition3;
            a -= b*!condition3;
            /*
            if (condition3)
            //if (a <b)
                b -= a;
            else
                a -= b;
                */
		}

    return b;
}

